import React, { Component, Fragment }  from 'react';
import logo from './logo.svg';
import './App.css';
import { get_products }  from './test';


class ProductList extends Component {

    constructor() {
        super();

        this.state = {
            products: [],
        }
    }

    fetchProducts = () => {
        this.setState({
            products: []
        });

        get_products().then(response => {
            this.setState({
                products: response
            });
        });
    };

    render() {
      return (
        <div className="App">
        <div>{this.state.products}</div>
        </div>
      );
    }
}

export default ProductList;
